import React from 'react';
import ReactDOM from 'react-dom';

const Header = (props) => {
  return(
    <>
      <h1>{props.course}</h1>
    </>
  )
};

const Part1 = (props) => {
  return(
    <p>
      {props.part1Sub} {props.exercise1Sub}
    </p>
  )
};

const Part2 = (props) => {
  return (
    <p>
      {props.part2Sub} {props.exercise2Sub}
    </p>
  )
};

const Part3 = (props) => {
  return (
    <p>
      {props.part3Sub} {props.exercise3Sub}
    </p>
  )
};


const Content = (props) => {
  return (
    <div>
      <Part1 part1Sub={props.part1} exercise1Sub={props.exercise1} />
      <Part2 part2Sub={props.part2} exercise2Sub={props.exercise2} />
      <Part3 part3Sub={props.part3} exercise3Sub={props.exercise3} />
    </div>
  )
};
const Total = (props) => {
  return (
    <>
      <p>Number of exercises {props.total}</p>
    </>
  )
};

const App = () => {
  const course = 'Half Stack application development';
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header course={course} />
      <Content
        part1={parts[0].name}
        exercise1={parts[0].exercises}
        part2={parts[1].name}
        exercise2={parts[1].exercises}
        part3={parts[2].name}
        exercise3={exercises3}
      />
      <Total total={parts[0].exercises + parts[1].exercises + parts[2].exercises} />
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'));


